      setLoading(true);
      const data = await getAllBuildings({
        pageNumber: currentPage,
        pageSize: 20,
        sortColumn,
        sortOrder,
      });
  
      setBuildings(data?.item_list);
      setCount(data?.total_items);
  
      setLoading(false);
    };
    
  return (
    <div>
        <h1>Product</h1>
        </div>
  )
}

